// Get input data from form
const formData = $input.item.json;

// Extract form fields
const date = formData['Date'];
const customerName = formData['Customer Name'];
const email = formData['Email Address'];
const phone = formData['Phone Number'];
const address = formData['Property Address'];
const bedrooms = parseInt(formData['Number of Bedrooms (including basement)']) || 0;
const sqFeet = parseFloat(formData['Total Living Area (square feet)']) || 0;

// Fixture counts (default to 0 if not provided)
const bathrooms = parseInt(formData['3 or 4 pc Bathrooms']) || 0;
const toilets = parseInt(formData['Toilets (not included in bathroom groups)']) || 0;
const sinks = parseInt(formData['Extra Sinks']) || 0;
const showers = parseInt(formData['Extra Shower/bathtub (1 head)']) || 0;
const dishwasher = parseInt(formData['Domestic Dishwasher']) || 0;
const washingMachine = parseInt(formData['Clothes Washing Machine']) || 0;
const laundryTub = parseInt(formData['Laundry Tub/Tray']) || 0;
const bidet = parseInt(formData['Bidet']) || 0;
const floorDrains = parseInt(formData['Floor Drains']) || 0;

// ========================================
// 1. CONVERT SQUARE FEET TO SQUARE METERS
// ========================================
const sqMeters = sqFeet * 0.09294;

// ========================================
// 2. CALCULATE BEDROOM FLOW RATE
// ========================================
let bedroomBaseFlow = 0;
if (bedrooms === 1) bedroomBaseFlow = 750;
else if (bedrooms === 2) bedroomBaseFlow = 1100;
else if (bedrooms === 3) bedroomBaseFlow = 1600;
else if (bedrooms === 4) bedroomBaseFlow = 2000;
else if (bedrooms >= 5) bedroomBaseFlow = 2500;

// Additional bedroom flow for bedrooms over 5
const additionalBedroomFlow = bedrooms > 5 ? (bedrooms - 5) * 500 : 0;
const totalBedroomFlow = bedroomBaseFlow + additionalBedroomFlow;

// ========================================
// 3. CALCULATE LIVING AREA FLOW
// ========================================
let livingAreaFlow = 0;

// Calculate area in each bracket
let area_0_200 = 0;
let area_200_400 = 0;
let area_400_600 = 0;
let area_600_plus = 0;

if (sqMeters > 200) {
  area_0_200 = 200;

  if (sqMeters > 400) {
    area_200_400 = 200;

    if (sqMeters > 600) {
      area_400_600 = 200;
      area_600_plus = sqMeters - 600;
    } else {
      area_400_600 = sqMeters - 400;
    }
  } else {
    area_200_400 = sqMeters - 200;
  }
} else {
  area_0_200 = sqMeters;
}

// Apply flow rates per bracket
const flow_0_200 = area_0_200 * 0; // 0 liters per sq m
const flow_200_400 = (area_200_400 * 100) / 10; // 100 liters per 10 sq m
const flow_400_600 = (area_400_600 * 75) / 10; // 75 liters per 10 sq m
const flow_600_plus = (area_600_plus * 50) / 10; // 50 liters per 10 sq m

livingAreaFlow = flow_0_200 + flow_200_400 + flow_400_600 + flow_600_plus;

// ========================================
// 4. CALCULATE FIXTURE FLOW
// ========================================
const fixtureUnits = {
  bathrooms: bathrooms * 6,
  showers: showers * 4,
  sinks: sinks * 1.5,
  bidet: bidet * 1.5,
  dishwasher: dishwasher * 0, // Not counted separately per Excel
  washingMachine: washingMachine * 1.5,
  laundryTub: laundryTub * 1.5,
  toilets: toilets * 1,
  floorDrains: floorDrains * 2
};

const totalFixtureUnits = 
  fixtureUnits.bathrooms + 
  fixtureUnits.showers + 
  fixtureUnits.sinks + 
  fixtureUnits.bidet + 
  fixtureUnits.dishwasher + 
  fixtureUnits.washingMachine + 
  fixtureUnits.laundryTub + 
  fixtureUnits.toilets + 
  fixtureUnits.floorDrains;

// Additional flow for fixtures over 20 units
const fixturesOver20Flow = totalFixtureUnits > 20 ? (totalFixtureUnits - 20) * 50 : 0;

// ========================================
// 5. CALCULATE DESIGN DAILY SEWAGE FLOW
// ========================================
// Per Excel logic: Take the maximum of:
// - Additional bedroom flow (for bedrooms over 5)
// - Fixtures over 20 flow
// - Living area flow
const maxAdditionalFlow = Math.max(additionalBedroomFlow, fixturesOver20Flow, livingAreaFlow);

// Total design daily sewage flow = base bedroom flow + max additional flow
const designDailySewageFlow = bedroomBaseFlow + maxAdditionalFlow;

// ========================================
// 6. CALCULATE SEPTIC TANK SIZE
// ========================================
const septicTankSize = designDailySewageFlow * 2;

// Calculate T time (16 min per cm)
const tTime = 16; // minutes per cm

// Calculate infiltrator chambers (QT/300 = Metres)
const infiltratorChambers = (designDailySewageFlow * tTime) / 300;

// ========================================
// 7. PREPARE OUTPUT DATA
// ========================================
return {
  customerInfo: {
    date: date,
    name: customerName,
    email: email,
    phone: phone,
    address: address
  },
  inputs: {
    bedrooms: bedrooms,
    sqFeet: sqFeet,
    sqMeters: Math.round(sqMeters * 100) / 100,
    fixtures: {
      bathrooms: bathrooms,
      toilets: toilets,
      sinks: sinks,
      showers: showers,
      dishwasher: dishwasher,
      washingMachine: washingMachine,
      laundryTub: laundryTub,
      bidet: bidet,
      floorDrains: floorDrains
    }
  },
  calculations: {
    bedroomFlow: {
      baseFlow: bedroomBaseFlow,
      additionalFlow: additionalBedroomFlow,
      totalFlow: totalBedroomFlow
    },
    livingAreaFlow: {
      area_0_200_sqm: Math.round(area_0_200 * 100) / 100,
      area_200_400_sqm: Math.round(area_200_400 * 100) / 100,
      area_400_600_sqm: Math.round(area_400_600 * 100) / 100,
      area_600_plus_sqm: Math.round(area_600_plus * 100) / 100,
      flow_0_200: Math.round(flow_0_200 * 100) / 100,
      flow_200_400: Math.round(flow_200_400 * 100) / 100,
      flow_400_600: Math.round(flow_400_600 * 100) / 100,
      flow_600_plus: Math.round(flow_600_plus * 100) / 100,
      totalLivingAreaFlow: Math.round(livingAreaFlow * 100) / 100
    },
    fixtureFlow: {
      totalUnits: Math.round(totalFixtureUnits * 100) / 100,
      fixturesOver20Flow: fixturesOver20Flow,
      breakdown: fixtureUnits
    },
    designDailySewageFlow: Math.round(designDailySewageFlow * 100) / 100,
    septicTankSize: Math.round(septicTankSize * 100) / 100,
    infiltratorChambers: Math.round(infiltratorChambers * 100) / 100
  },
  summary: {
    designDailySewageFlowLiters: Math.round(designDailySewageFlow * 100) / 100,
    septicTankSizeLiters: Math.round(septicTankSize * 100) / 100,
    infiltratorChambersMeters: Math.round(infiltratorChambers * 100) / 100
  }
};

// Prepare contract data for PDF generation
const data = $input.item.json;

// Format date
const contractDate = new Date(data.customerInfo.date).toLocaleDateString('en-US', {
  year: 'numeric',
  month: 'long',
  day: 'numeric'
});

// Generate contract number
const contractNumber = 'SBS-' + Date.now().toString().slice(-8);

return {
  // Contract Header
  contractNumber: contractNumber,
  contractDate: contractDate,
  companyName: 'Silver Bullet Septic Services Inc.',
  companyAddress: '1263 Highway 5W Dundas ON L8H 5E1',
  companyBCIN: 'Rodney Slagter BCIN 34588',

  // Customer Info
  customerName: data.customerInfo.name,
  customerEmail: data.customerInfo.email,
  customerPhone: data.customerInfo.phone,
  propertyAddress: data.customerInfo.address,

  // Property Details
  bedrooms: data.inputs.bedrooms,
  sqFeet: data.inputs.sqFeet,
  sqMeters: data.inputs.sqMeters,

  // Fixtures Summary
  bathrooms: data.inputs.fixtures.bathrooms,
  toilets: data.inputs.fixtures.toilets,
  sinks: data.inputs.fixtures.sinks,
  showers: data.inputs.fixtures.showers,
  dishwashers: data.inputs.fixtures.dishwasher,
  washingMachines: data.inputs.fixtures.washingMachine,
  laundryTubs: data.inputs.fixtures.laundryTub,
  bidets: data.inputs.fixtures.bidet,
  floorDrains: data.inputs.fixtures.floorDrains,
  totalFixtureUnits: data.calculations.fixtureFlow.totalUnits,

  // Calculations
  bedroomBaseFlow: data.calculations.bedroomFlow.baseFlow,
  bedroomAdditionalFlow: data.calculations.bedroomFlow.additionalFlow,
  livingAreaFlow: data.calculations.livingAreaFlow.totalLivingAreaFlow,
  fixtureOverflow: data.calculations.fixtureFlow.fixturesOver20Flow,

  // Final Results
  designDailySewageFlow: data.summary.designDailySewageFlowLiters,
  septicTankSize: data.summary.septicTankSizeLiters,
  infiltratorChambers: data.summary.infiltratorChambersMeters,

  // Full data for reference
  fullData: data
};

